import React, { useState } from "react";
import "./navBar.css"
import logo from "./logo.png"

function NavBar() {
        const [open, setOpen] = useState(false);
        const [openGame, setOpengame] = useState(false)
        function dropDown() {
            setOpen(true)
        }

        function menuDd(e) {

        if(e.target.id === "game") {    
            return (<div className="container-dd">
                <li>ABOUT</li>
                <li>STORY</li>
                <li>CLASSES</li>
                <li>MEDIA</li>
                <li>FAQ</li>
            </div>)
        }
        if(e.target.id === "community") {
            return (<div className="container-ddCom">
                <li>SOCIAL FEED</li>
                <li>CREATOR OF PROGRAM</li>
                <li>LEGENDS OF LOST ARK</li>
                <li>ARMORY EXTENSION</li>
                <li>FORUM</li>
            </div>)
        }
}


    return (
        <div className="navBarContainer">
            <ul className="navBar">
            <div className="logo"><img className="logoImg" src={logo} alt="logo"></img></div>
                <li className="navLi" id="game"><button className="liBtn" onClick={() => dropDown()}>GAME</button>{openGame ? menuDd() : null }</li>
                <li className="navLi"><button className="liBtn" >NEWS</button></li>
                <li className="navLi" id="community"><button className="liBtn" onClick={() => dropDown()}>COMMUNITY</button>{open ? menuDd() : null}</li>
                <li className="navLi"><button className="liBtn">SUPPORT</button></li>
            </ul>
            <button className="packBtn">BUY FOUNDER'S PACK</button>
        </div>
    )
}

export default NavBar;
